use 5.024;
use warnings;

my ($n,$l) = <> =~ /^(\d+) (\d+)$/ or die "Bad line $.\n";
my $template; vec( $template, $_, 1 ) = 1 for 0..$n-1;

my @votes;
while ($l--) {
    my ($v,$s) = <> =~ /^(\d+) (\d+)$/ or die "Bad line $.\n";
    vec( $votes[--$v], --$s, 1 ) = 1;
}

for my $i (0 .. $n-1) {
    $_ = $votes[$i];
    vec( $_, $i, 1 ) = 1;
    say 'NOTHING TO SEE HERE' and exit if $_ ne $template;
}
say 'CLIQUE';

say 'Uh-oh' unless eof;
